import './index.css';




const App = () =>{
    let tm =new Date().toLocaleTimeString();

    const [ctime, setCount] = useState(tm);
     const uptime = () =>{
         ntime =new Date().toLocaleTimeString();
       setCount(ntime)
     }

    return(
        <>
        <h1>{ctime}</h1>
        <button onClick={uptime}>Click me</button>
        </>
    );
}
export default App;
